import React from "react";
import Navprofile from "./Components/navprofile/Navprofile";
import { Box } from "@mui/system";
const Test = () => {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyItems: "column",
        width: "1680px",
        height: "1050px",
      }}
    >
      <div
        style={{ backgroundColor: "yellow", width: "80px", maxWidth: "400px" }}
      >
        <Box sx={{ position: "fixed" }}>
          <Navprofile />
        </Box>
      </div>
    </div>
  );
};

export default Test;
